import * as s from './Sidebar_style'

const Sidebar = () => {
    const backgroundImage = './sidebar.jpeg'
    const imageName = require('./sidebar.jpeg')

    return ( 
        <s.Container backgroundImage={backgroundImage}>
           <img src={imageName} width="50" height="50"/>
        </s.Container>
     );
}

export default Sidebar;
